    {
      "cell_type": "markdown",
      "source": [
        "**2.1 Extract Side Effect Severity (NLP-Based)**"
      ],
      "metadata": {
        "id": "7IKs9TOvpd05"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "# Use sentiment analysis to score side effect severity\n",
        "def get_side_effect_sentiment(text):\n",
        "    analysis = TextBlob(text)\n",
        "    return analysis.sentiment.polarity  # -1 (bad) to +1 (good)\n",
        "\n",
        "df['side_effect_sentiment'] = df['side_effects'].apply(get_side_effect_sentiment)"
      ],
      "metadata": {
        "id": "pJuKnNEjph_j"
      },
      "execution_count": 10,
      "outputs": []
    },
    {
      "cell_type": "markdown",
      "source": [
        "**2.2 One-Hot Encode Categorical Variables**"
      ],
      "metadata": {
        "id": "gyL7G1yCpqLN"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "# Convert drug classes into dummy variables\n",
        "drug_class_dummies = df['drug_classes'].str.get_dummies(', ')\n",
        "df = pd.concat([df, drug_class_dummies], axis=1)\n",
        "\n",
        "# Encode medical conditions\n",
        "le = LabelEncoder()\n",
        "df['medical_condition_encoded'] = le.fit_transform(df['medical_condition'])"
      ],
      "metadata": {
        "id": "4SEPvyI-pvLP"
      },
      "execution_count": 11,
      "outputs": []
    },
