    {
      "cell_type": "markdown",
      "source": [
        "**5. Clustering Drugs Based on Side Effects & Ratings**"
      ],
      "metadata": {
        "id": "WQEFeqTsrcLR"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "**5.1 K-Means Clustering**"
      ],
      "metadata": {
        "id": "e8JoqzlgrjLj"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "from sklearn.cluster import KMeans\n",
        "\n",
        "# Select features for clustering\n",
        "cluster_data = df[['rating', 'side_effect_sentiment', 'no_of_reviews']]\n",
        "\n",
        "# Standardize\n",
        "scaler = StandardScaler()\n",
        "cluster_scaled = scaler.fit_transform(cluster_data)\n",
        "\n",
        "# Apply K-Means\n",
        "kmeans = KMeans(n_clusters=4, random_state=42)\n",
        "df['cluster'] = kmeans.fit_predict(cluster_scaled)"
      ],
      "metadata": {
        "id": "u-L6jvcfrn6I"
      },
      "execution_count": null,
      "outputs": []
    },
